import React from "react";
import Layout from "../components/Layout";
import { Container, Row, Col } from "reactstrap";

class News extends React.Component {
  constructor(props) {
    super(props);
    this.state = {};
  }

  render() {
    return (<Layout>News</Layout>);
  }
}

export default News;
